import { Card, Col, Row } from "antd";

import "./InternshipsList.scss";

const categoryWidths = {
  internshipTitle: { lg: 2, xl: 4, xxl: 6 },
  completitionPeriod: { lg: 2, xl: 4, xxl: 6 },
  totalEnrolled: { lg: 2, xl: 4, xxl: 6 },
  qualifiedCandidates: { lg: 2, xl: 4, xxl: 6 },
  icons: { lg: 2, xl: 4, xxl: 6 },
};

const InternshipsList = () => {
  const renderCategoryRow = () => {
    return <Row justify="center"></Row>;
  };

  return (
    <Card bodyStyle={{ height: "100%", padding: "0px" }} className="internshipListCard">
      <Row justify="center" style={{ height: "100%" }}>
        <Col span={24}>{renderCategoryRow()}</Col>
        <Col span={24} />
      </Row>
    </Card>
  );
};

export default InternshipsList;
